/* carousel styles */
.carousel {
  width: 100%;
  position: relative;
  overflow: hidden;
}

.carousel--buttons [data-hidden="true"] {
  display: none;
}

.carousel--buttons button {
  background: transparent;
  border: none;
  position: absolute;
  height: 100%;
  z-index: 2;
  cursor: pointer;
}

.prev {
  left: 10px;
}

.next {
  right: 10px;
}

.carousel--content {
  height: inherit;
  width: 100%;
  margin: 0;
  padding: 0;
  z-index: 1;
}

.carousel--indicator {
  text-align: center;
  z-index: 3;
  position: absolute;
  bottom: 0;
  left: 50%;
  -webkit-transform: translateX(-50%);
    -ms-transform: translateX(-50%);
        transform: translateX(-50%);
}

.carousel--indicator li[data-selected="true"] {
  background-color: #fff;
}

.carousel--indicator-item {
  display: inline-block;
  cursor: pointer;
  bottom: 0;
  width: 9px;
  height: 9px;
  background-color: transparent;
  border: solid 1px #fff;
  border-radius: 50%;
  margin-right: 5px;
}

.carousel--content-item {
  font-size: 100px;
  width: 100%;
  list-style: none;
  text-align: center;
  position: absolute;
  opacity: 0;
}

.carousel--content-item[data-current="true"] {
  opacity: 1;
}

/* 'fade' carousel transitions */
#carousel_fade .carousel--content-item {
  transition: opacity .6s ease-in-out;
  opacity: 0;
}

#carousel_fade .carousel--content-item[data-current="true"] {
  opacity: 1;
}

/* 'move left' carousel transitions */
#carousel_move-left .carousel--content-item {
  transition: all .6s ease-in-out;
  left: 100%;
}

#carousel_move-left .carousel--content-item[data-previous="true"] {
  left: -100%;
}

